DROP TABLE IF EXISTS `xiehua_weixin_user`;
CREATE TABLE `xiehua_weixin_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '唯一标识',
  `creator_id` varchar(20) NOT NULL DEFAULT '' COMMENT '创建人',
  `modifier_id` varchar(20) NOT NULL DEFAULT '' COMMENT '修改人',
  `generate_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间（不能用于业务）',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间（不能用于业务）',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `open_id` varchar(255) NOT NULL DEFAULT '' COMMENT 'open_id',
  `nickname` varchar(255) DEFAULT '' COMMENT '用户昵称',
  `sex` smallint(1) DEFAULT '0' COMMENT '用户的性别，值为1时是男性，值为2时是女性，值为0时是未知',
  `province` varchar(255) DEFAULT '' COMMENT '用户个人资料填写的省份',
  `city` varchar(255) DEFAULT '' COMMENT '普通用户个人资料填写的城市',
  `country` varchar(255) DEFAULT '' COMMENT '国家，如中国为CN',
  `headimgurl` varchar(255) DEFAULT '' COMMENT '用户头像',
  `subscribe` tinyint(4) NOT NULL DEFAULT '0' COMMENT '关注:0取消关注,1关注',
  `his_subscribe` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否历史关注过',
  `subscribe_source` varchar(255) NOT NULL DEFAULT '' COMMENT '关注渠道',
  `subscribe_time` datetime DEFAULT NULL COMMENT '管住是件',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COMMENT='微信用户表';

